import React from 'react';
import { Paper, Typography, Box, CircularProgress } from '@mui/material';

const RecoveryGoal = () => {
  const progress = 75; // Example progress value

  return (
    <Paper elevation={3} sx={{ p: 3, height: '300px', display: 'flex', flexDirection: 'column', justifyContent: 'space-between' }}>
      <Typography variant="h5">Recovery goal</Typography>
      <Box sx={{ position: 'relative', display: 'inline-flex' }}>
        <CircularProgress variant="determinate" value={progress} size={120} />
        <Box
          sx={{
            top: 0,
            left: 0,
            bottom: 0,
            right: 0,
            position: 'absolute',
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center',
          }}
        >
          <Typography variant="caption" component="div" color="text.secondary">
            {`${Math.round(progress)}%`}
          </Typography>
        </Box>
      </Box>
      <Typography variant="body2">Get better by +{progress}%</Typography>
    </Paper>
  );
};

export default RecoveryGoal;
